import React, { Component } from 'react';

import {RoomList,MessageList,NewRoomForm,SendMessageForm} from './components'
import io from './components/socket'

class App extends Component {
    constructor(props){
        super(props)
    this.socket  = io(()=>console.log("connected")) //socket connection
    }
    render() {
    return (
        <div className="app">
            <RoomList />
            <MessageList />
            <SendMessageForm socket={this.io}/>
            <NewRoomForm />
        </div>
    );
}
}

export default App;
